import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Livros.css';

const Livros = () => {
  const [livros, setLivros] = useState([]);
  const [editingLivro, setEditingLivro] = useState(null);
  const [editForm, setEditForm] = useState({
    titulo: '',
    autor: '',
    genero: '',
    anoPublicacao: ''
  });

  // Fetch dos livros ao carregar a página
  useEffect(() => {
    fetchLivros();
  }, []);

  const fetchLivros = async () => {
    try {
      const response = await axios.get('http://localhost:3000/api/livros');
      setLivros(response.data);
    } catch (error) {
      console.error('Erro ao buscar os livros:', error);
    }
  };

  const handleEditClick = (livro) => {
    setEditingLivro(livro);
    setEditForm({
      titulo: livro.titulo,
      autor: livro.autor,
      genero: livro.genero,
      anoPublicacao: livro.anoPublicacao
    });
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setEditForm({ ...editForm, [name]: value });
  };

  const handleEditSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.put(`http://localhost:3000/api/livros/${editingLivro._id}`, editForm);
      setEditingLivro(null);
      fetchLivros(); // Atualiza a lista após a edição
    } catch (error) {
      console.error('Erro ao editar o livro:', error);
    }
  };

  return (
    <div className="livros-container">
      <h1>Gerenciar Livros</h1>
      <ul className="livros-list">
        {livros.map((livro) => (
          <li key={livro._id}>
            <strong>ID:</strong> {livro._id}<br />
            <strong>Título:</strong> {livro.titulo}<br />
            <strong>Autor:</strong> {livro.autor}<br />
            <strong>Gênero:</strong> {livro.genero}<br />
            <strong>Ano de Publicação:</strong> {livro.anoPublicacao}<br />
            <button onClick={() => handleEditClick(livro)}>Editar</button>
          </li>
        ))}
      </ul>

      {/* Modal de edição */}
      {editingLivro && (
        <div className="edit-modal">
          <h2>Editar Livro</h2>
          <form onSubmit={handleEditSubmit}>
            <label>
              Título:
              <input
                type="text"
                name="titulo"
                value={editForm.titulo}
                onChange={handleInputChange}
              />
            </label>
            <label>
              Autor:
              <input
                type="text"
                name="autor"
                value={editForm.autor}
                onChange={handleInputChange}
              />
            </label>
            <label>
              Gênero:
              <input
                type="text"
                name="genero"
                value={editForm.genero}
                onChange={handleInputChange}
              />
            </label>
            <label>
              Ano de Publicação:
              <input
                type="number"
                name="anoPublicacao"
                value={editForm.anoPublicacao}
                onChange={handleInputChange}
              />
            </label>
            <button type="submit">Salvar</button>
            <button type="button" onClick={() => setEditingLivro(null)}>Cancelar</button>
          </form>
        </div>
      )}
    </div>
  );
};

export default Livros;
